(89, '在“文化大革命”结束后的两年间，（   ）。  ', 'A', NULL, NULL, 'A.没有从指导思想上彻底清理‚文化大革命‛的错误', 'B.实现历史的转折', 'C.经济结构趋于改善  ', NULL, 1),
(90, '在中国面临向何处去的重大历史关头，邓小平的（  ）讲话是开辟新时期新道路的宣言书，标志着中国共产党人在新的时代条件下的一个了不起的伟大觉醒。  ', 'A', NULL, NULL, 'A.《解放思想，实事求是，团结一致向前看》', 'B.《贫穷不是社会主义》', 'C.《科技是第一生产力》 ', NULL, 1),
(91, '实事求是评价毛泽东的历史地位的是（    ）。 ', 'B', NULL, NULL, 'A.《中国共产党第十一届中央委员会第三次全体会议决议》  ', 'B.《中国共产党中央委员会关于建国以来党的若干历史问题的决议》  ', 'C.《中共中央关于经济体制改革的决定》第二章     改革开放的性质和目的  ', NULL, 1),
(92, '通过改革开放，实现了（    ）的转移，冲破了束缚生产力发展的体制障碍。 ', 'A', NULL, NULL, 'A.党的工作中心  ', 'B.党的奋斗目标        ', ' C.国家社会性质  ', NULL, 1),
(93, '改革开放极大地解放和发展了社会生产力，推动了社会主义市场经济体制的（  ）建立。 ', 'B', NULL, NULL, 'A.完全   ', '  B.初步    ', 'C.全面 ', NULL, 1),
(94, '目前，我国需求结构中（    ）。投资与消费比例失衡，使得居民生活不能随着经济快速增长而同步提高，导致国内市场规模受限，生产能力相对过剩。', 'A', NULL, NULL, 'A.投资率偏高，消费率较低        ', 'B.投资率偏低，消费率较高     ', 'C.投资和消费都不足 \n', NULL, 1),
(95, '一个国家要实现经济社会又好又快发展，必须找到一条（   ）的发展道路。 ', 'C', NULL, NULL, 'A.既重视效益，又重视数量', 'B.既吸收传统，又借鉴他国', 'C.既适合自己国情，又符合时代要求  \n', NULL, 1),
(96, '以（   ）为标志，我们党开创了以经济建设为中心的历史发展新时期，找到了建设和发展中国特色社会主义的新道路', 'B', NULL, NULL, 'A.文化大革命的结束', 'B.改革开放', 'C.中国共产党第十二次全国代表大会 ', NULL, 1),
(97, '我们党在新时期的全部理论和实践都是紧紧围绕（   ）这个主题开展的。', 'A', NULL, NULL, 'A.建设、捍卫和发展中国特色社会主义', 'B.坚持和完善社会主义市场经济', 'C.政治民主  ', NULL, 1),
(98, '（    ）明确提出了经济体制改革的目标是建立社会主义市场经济体制。', 'A', NULL, NULL, 'A.中国共产党第十三次全国代表大会', 'B.中国共产党第十四次全国代表大会 ', 'C.中国共产党第十一届中央委员会第三次全体会议 ', NULL, 1),
(99, '    ）制定了我国跨世纪发展战略，把建设有中国特色社会主义全面推向21世纪。', 'C', NULL, NULL, 'A.中国共产党第十三次全国代表大会', 'B.中国共产党第十四次全国代表大会 ', 'C.中国共产党第十五次全国代表大会  \n', NULL, 1),
(100, '（    ）明确提出了全面建设小康社会的奋斗目标，要求全党进一步开创中国特色社会主义新局面。 ', 'B', NULL, NULL, 'A.中国共产党第十四次全国代表大会', 'B.中国共产党第十六次全国代表大会 ', 'C.中国共产党第十一届中央委员会第三次全体会议\n', NULL, 1),
(101, '（    ）高举中国特色社会主义伟大旗臶，在新的历史起点上为继续发展中国特色社会主义制定了行动纲领。 ', 'C', NULL, NULL, 'A.中国共产党第十一届中央委员会第三次全体会议', 'B.中国共产党第十四次全国代表大会 ', 'C.中国共产党第十七次全国代表大会 ', NULL, 1),
(102, '邓小平在（    ）召开的中央工作会议上，他发表了《解放思想，实事求是，团结一致向前看》的重要讲话，指出：“不打破思想僵化，不大大解放干部和群众的思想，四个现代化就没有希望。” ', 'B', NULL, NULL, 'A.1978年11月     ', ' B.1978年12月      ', 'C.1982年9月 ', NULL, 1),
(103, '65.以邓小平同志为主要代表的中国共产党人形成了（   ）、社会主义市场经济论、社会主义本质论等一系列新思想新理论以及党在社会主义初级阶段“一个中心，两个基本点”的基本路线。 ', 'B', NULL, NULL, 'A.社会主义性质论       ', 'B.社会主义初级阶段论       ', 'C.社会主义阶层论 \n', NULL, 1),
(104, '改革开放开辟了马克思主义关于建设什么样的党。怎样建设党理论的新境界。（  ）以后，国际形式风云变幻，我国改革开放和现代化建设面临严峻考验。  ', 'A', NULL, NULL, 'A.中国共产党第十三届中央委员会第四次全体会议', 'B.中国共产党第十三届中央委员会第五次全体会议 ', 'C.中国共产党第十三届中央委员会第六次全体会议  \n', NULL, 1),
(105, '我们党从容答应对一系列关系我国主权和安全的国际突发事件。胜利实现了现代化建设“三步走”战略（   ）目标，进入了全面建设小康社会、加快推进社会主义现代化新的发展阶段。 ', 'B', NULL, NULL, 'A.第一步     ', 'B.前两步     ', 'C.全部', NULL, 1),
(106, '新世纪新阶段，我国发展站在了新的历史起点上。随着工业化、（   ）、城市化、市场化、国际化的不断发展，我国发展呈现出一系列新的阶段性特征。 ', 'C', NULL, NULL, 'A.机械化            ', '   B.电子化       ', 'C.信息化  ', NULL, 1),
(107, '科学发展明确了我国仍处于并将长期处于社会主义初级阶段而又处在新的历史起点的发展方位，形成了“第一要义是发展，核心是（    ），基本要求是全面协调可持续，根本方法是统筹兼顾”的系统理论。 ', 'B', NULL, NULL, 'A.自主创新       ', 'B.以人为本      ', ' C.科学发展 ', NULL, 1),
(108, '从邓小平理论到“三个代表”重要思想，再到（   ），这三大马克思主义中国化的理论成果都是中国共产党人在改革开放的伟大进程中不断解放思想，形成的一脉相承又与时俱进的中国特色社会主义理论体系。 ', 'A', NULL, NULL, 'A.科学发展观    ', 'B.以人为本观       ', 'C.和谐社会关观 ', NULL, 1),
(109, '（   ）是改革开放的基本出发点和落脚点', 'A', NULL, NULL, 'A.改善人民生活 ', 'B.提高综合国力      ', 'C.和平与发展 ', NULL, 1),
(110, '中国特色社会主义道路之所以完全正确、之所以能够引领中国发展进步，关键在于我们既坚持了（   ）的基本原则，又根据我国实际和时代特征赋予其鲜明的中国特色。', 'B', NULL, NULL, 'A.共产主义 ', 'B.科学社会主义 ', ' C.马克思主义', NULL, 1),
(111, '我国社会主义初级阶段的主要矛盾是（    ）。  ', 'C', NULL, NULL, 'A.先进的社会主义生产关系与落后社会生产力的矛盾', 'B.无产阶级同资产阶级之间的矛盾 ', 'C.人民日益增长的物质文化需要同落后的社会生产之间的矛盾\n', NULL, 1),
(112, '对外开放是（   ）。', 'C', NULL, NULL, 'A.我国的一项基本国策；全方位、多层次的开放；长期的政策 ', 'B.我国的一项基本国策；全方位、多层次的开放；全面的开放  ', 'C.我国的一项基本国策；全方位、多层次的开放；长期的政策；全面的开放\n', NULL, 1),
(113, '我国对社会主义所处的发展阶段经历了一个长期的探索过程，这些有益的探索包括（    ）。 ', 'B', NULL, NULL, 'A.毛泽东曾提出社会主义可能分为不发达社会主义与比较发达社会主义；《关于建国以来党的若干历史问题的决议》第一次使用了“我国的社会主义制度还是处于初级阶段”；中国共产党第十三次全国代表大会报告全面阐述了社会主义初级阶段理论  ', 'B.毛泽东曾提出社会主义可能分为不发达社会主义与比较发达社会主义；《关于建国以来党的若干历史问题的决议》第一次使用了“我国的社会主义制度还是处于初级阶段”； 中国共产党第十二次全国代表大会报告正式提出‚我国的社会主义还处在初级发展成阶段； 中国共产党第十三次全国代表大会报告全面阐述了社会主义初级阶段理论  ', 'C.《关于建国以来党的若干历史问题的决议》第一次使用了“我国的社会主义制度还是处于初级阶段”；中国共产党第十二次全国代表大会报告正式提出‚我国的社会主义还处在初级发展成阶段‛；中国共产党第十三次全国代表大会报告全面阐述了社会主义初级阶段理论', NULL, 1),
(114, '改革开放是（    ），是我们党和国家发展进步的活力源泉。 ', 'B', NULL, NULL, 'A.兴国之要         ', 'B.强国之路         ', 'C.立国之本', NULL, 1),
(115, '改革开放新时期最显著的成就是快速发展。从“发展才是硬道理”到（  ），再到实现科学发展，党带领中国人民实现了社会生产力的发展和综合国力的跃升。', 'A', NULL, NULL, 'A.“发展是党执政兴国的第一要务” ', 'B.“可持续发展” ', 'C.“均衡发展” ', NULL, 1),
(116, '随着工业化、城镇化步伐加快，（    ）状况对经济发展已构成严重制约，城乡之间、区域之间、经济与社会之间发展不平衡的矛盾趋于突出。', 'C', NULL, NULL, 'A.供求矛盾       ', 'B.东西差距        ', 'C.资源环境 ', NULL, 1),
(117, '进入新世纪，如何以更好的质量、更多的品种满足多样化的社会需求，通过（    ），以具有自主知识产权和知名品牌的产品开拓市场，成为持续快速发展的关键因素。 ', 'A', NULL, NULL, 'A.自主创新      ', 'B.独立自主，自力更生    ', 'C.“引进来，走出去”', NULL, 1),
(118, '我坚持党的基本路线100年不动摇，必须做到（    ）。 ', 'A', NULL, NULL, 'A.关键是以坚持经济建设为中心；正确处理两个基本点之间的关系，把二者统一起来；警惕和防止“左”右两种错误倾向；更主要是防止“左”的错误  ', 'B.关键是以坚持经济建设为中心；正确处理两个基本点之间的关系，把二者统一起来；警惕和防止“左”右两种错误倾向；  ', 'C.关键是以坚持经济建设为中心；正确处理两个基本点之间的关系，把二者统一起来；更主要是防止“左”的错误', NULL, 1),
(119, '81.党在领导改革开放的历程中端正了指导思想，重新确立了马克思主义的思想路线、政治路线和组织路线，党的思想，组织，作风、（    ）建设以及反腐倡廉建设得到全面加强和改善。 ', 'C', NULL, NULL, 'A.风气         ', 'B.文化        ', 'C.制度 ', NULL, 1),
(120, '2003年以来，我国经济连续多年保持了平稳较快增长。但经济生活中仍存在一些矛盾和问题，有的还比较突出，主要是（   ）,信贷投放过多，贸易顺差过大等。  ', 'C', NULL, NULL, 'A.投资不足         ', 'B.消费增长过快         ', 'C.投资增长过快  ', NULL, 1);
